import React from 'react';

const WTCImage1 = () => {
  const imageUrl = 'https://media.istockphoto.com/id/1277222702/photo/9-11-tribute-in-light.jpg?s=612x612&w=0&k=20&c=lfJTj1-vJrI5dxERUL1Y88Ga72QYR-oRlibdiefxhM8=';

  return (
    <div
      style={{
        backgroundImage: `url(${imageUrl})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        width: '100vw',
        height: '100vh',
         backgroundAttachment: 'fixed',
        position: 'absolute',
      }}
    />
  );
};

export default WTCImage1;
